import React, { useState } from "react";
import Button from "./Button";
import Input from "./Input";

function Rectangle() {

    const [checkedOne, setCheckedOne] = useState(false);
    const [checkedTwo, setCheckedTwo] = useState(false);
    const [disabledOne, setDisabledOne] = useState(false);
    const [disabledTwo, setDisabledTwo] = useState(false);

    const handleChangeOne = () => {
        setCheckedOne(true);
        setCheckedTwo(false);
        setDisabledOne(false)
        setDisabledTwo(true)
    }

    const handleChangeTwo = () => {
        setCheckedTwo(true)
        setCheckedOne(false)
        setDisabledTwo(false)
        setDisabledOne(true)
    }
    
  return (
    <div className="rectangleWrapper">
      <div className="containerRectangle">
        <div className="rectangle">
            <Button />
        </div>
        <div className="rectangle">
          <Input handleChecked={handleChangeOne} disabled={disabledOne}  checked={checkedOne}/>
        </div>
        <div className="rectangle">
          <Input handleChecked={handleChangeTwo} disabled={disabledTwo}  checked={checkedTwo}/>
        </div>
      </div>
    </div>
  );
}

export default Rectangle;
